class FormUser extends Component {
    render() {
        let user = this.props.user.info;

        return (

                 <div>
                  <h4>{user.email}</h4>
        <h4>{user.uid}</h4>
        <h4>{user.website}</h4>
                  <button type="submit" className="btn btn-success">Logout</button>
                </div>

        );
    }
}

export default FormUser;
